
(async function () {
    console.log("[AiPlugin] Content Script Loaded");

    // [보안 우회] 메인 스레드와 오디오 워크렛 간의 통신을 위해 코드를 Base64로 관리합니다.
    const RUBBERBAND_BASE64 = "";

    // [설정] 테스트용 오디오 URL
    const TEST_AUDIO_URL = "https://www.soundhelix.com/examples/mp3/SoundHelix-Song-1.mp3";

    class AudioPitchController {
        constructor() {
            this.audioCtx = null;
            this.audioEl = null;
            this.sourceNode = null;
            this.workletNode = null;
            this.ws = null;
            this.apiPort = this.detectApiPort() || 5000;

            this.ui = {
                slider: null,
                display: null,
                status: null
            };

            // UI를 먼저 그려서 사용자에게 상태를 알림
            this.createOverlayUI();
            this.init();
        }

        detectApiPort() {
            if (document.currentScript && document.currentScript.src) {
                try {
                    const url = new URL(document.currentScript.src);
                    if (['127.0.0.1', 'localhost'].includes(url.hostname)) {
                        return url.port;
                    }
                } catch (e) { }
            }
            return 5000;
        }

        async init() {
            // 1. 페이지 내 미디어 요소 탐색
            this.audioEl = document.querySelector('video') || document.querySelector('audio');

            // [수정 1] 미디어가 없으면 테스트용 오디오 생성 (문자열 할당 오류 해결)
            if (!this.audioEl) {
                console.log("[PitchController] No media found. Creating test audio...");
                this.audioEl = new Audio(TEST_AUDIO_URL);
                this.audioEl.crossOrigin = "anonymous"; // CORS 문제 방지
                this.audioEl.loop = true;
                this.audioEl.controls = true; // 컨트롤 표시

                // 화면에 보이지 않으면 브라우저가 자동재생을 막을 수 있으므로 UI에 추가하거나 body에 추가
                // 여기서는 기존 UI 컨테이너 근처나 body에 추가합니다.
                this.audioEl.style.cssText = "position:fixed; bottom:10px; right:10px; z-index:99999;";
                document.body.appendChild(this.audioEl);

                this.ui.status.innerText = "⚠️ Created Test Audio";
            } else {
                // 기존 미디어가 있다면 CORS 설정 시도 (이미 로드된 경우 실패할 수 있음)
                if (!this.audioEl.crossOrigin) this.audioEl.crossOrigin = "anonymous";
            }

            // 2. WebSocket 연결
            this.connectWebSocket();

            // 3. [수정 2] 자동 재생 시도 (Autoplay Tester 기능 복구)
            try {
                // 브라우저 정책상 사용자 인터랙션 없이 AudioContext 생성은 실패할 수 있음
                // 일단 재생을 시도하고, 성공하면 오디오 그래프 연결
                await this.audioEl.play();
                console.log("[PitchController] Autoplay started.");
                this.setupAudioGraph();
            } catch (err) {
                console.warn("[PitchController] Autoplay blocked by browser:", err);
                this.ui.status.innerText = "Click 'Play' to Start";
                this.ui.status.style.color = "#ffeb3b";

                // 차단된 경우: 사용자가 클릭하면 시작하도록 대기
                const playHandler = async () => {
                    await this.setupAudioGraph();
                    this.audioEl.play();
                };

                // UI 전체에 클릭 리스너 추가 (편의성)
                document.body.addEventListener('click', playHandler, { once: true });
                this.audioEl.addEventListener('play', () => this.setupAudioGraph(), { once: true });
            }
        }

        createOverlayUI() {
            const container = document.createElement('div');
            container.style.cssText = `
                position: fixed; top: 20px; left: 20px; width: 220px;
                background: rgba(0, 0, 0, 0.85); color: white;
                padding: 15px; border-radius: 12px; z-index: 99999;
                font-family: sans-serif; box-shadow: 0 4px 15px rgba(0,0,0,0.5);
                backdrop-filter: blur(5px); border: 1px solid rgba(255,255,255,0.1);
            `;

            const title = document.createElement('div');
            title.innerText = "🎛 Pitch Shifter";
            title.style.cssText = "margin-bottom: 10px; font-weight: bold; color: #00d2ff;";

            this.ui.status = document.createElement('div');
            this.ui.status.innerText = "Initializing...";
            this.ui.status.style.cssText = "font-size: 12px; color: #aaa; margin-bottom: 15px;";

            this.ui.display = document.createElement('div');
            this.ui.display.innerText = "1.00x";
            this.ui.display.style.cssText = "text-align: right; font-size: 1.2em; font-weight: bold; margin-bottom: 5px;";

            this.ui.slider = document.createElement('input');
            this.ui.slider.type = "range";
            this.ui.slider.min = "0.5";
            this.ui.slider.max = "2.0";
            this.ui.slider.step = "0.01";
            this.ui.slider.value = "1.0";
            this.ui.slider.style.cssText = "width: 100%; cursor: pointer;";

            this.ui.slider.addEventListener('input', (e) => {
                const val = parseFloat(e.target.value);
                this.setPitch(val, false);
            });

            this.ui.slider.addEventListener('dblclick', () => {
                this.setPitch(1.0);
            });

            container.appendChild(title);
            container.appendChild(this.ui.status);
            container.appendChild(this.ui.display);
            container.appendChild(this.ui.slider);
            document.body.appendChild(container);
        }

        async setupAudioGraph() {
            // 중복 실행 방지
            if (this.audioCtx && this.audioCtx.state === 'running') return;

            try {
                const AudioContext = window.AudioContext || window.webkitAudioContext;
                // 기존 컨텍스트가 닫혀있으면 새로 생성하거나 resume
                if (!this.audioCtx) this.audioCtx = new AudioContext();
                if (this.audioCtx.state === 'suspended') await this.audioCtx.resume();

                // 이미 소스 노드가 연결되어 있다면 스킵
                if (this.sourceNode) return;

                // [핵심] createMediaElementSource에는 반드시 HTML Element가 들어가야 함
                this.sourceNode = this.audioCtx.createMediaElementSource(this.audioEl);

                if (RUBBERBAND_BASE64 === "YOUR_RUBBERBAND_WASM_BASE64_STRING_HERE") {
                    this.ui.status.innerText = "Mock Mode (PlaybackRate)";
                    this.sourceNode.connect(this.audioCtx.destination);
                } else {
                    const blob = new Blob([atob(RUBBERBAND_BASE64)], { type: 'application/javascript' });
                    const workletUrl = URL.createObjectURL(blob);
                    await this.audioCtx.audioWorklet.addModule(workletUrl);

                    this.workletNode = new AudioWorkletNode(this.audioCtx, 'rubberband-processor');
                    this.sourceNode.connect(this.workletNode);
                    this.workletNode.connect(this.audioCtx.destination);
                    this.ui.status.innerText = "🟢 Active (WASM)";
                }

                this.ui.status.style.color = "#4caf50";

            } catch (e) {
                console.error("[PitchController] Audio Graph Error:", e);
                this.ui.status.innerText = "❌ Audio Error";
                this.ui.status.style.color = "#f44336";
            }
        }

        setPitch(value, updateUi = true) {
            if (this.ui.display) this.ui.display.innerText = value.toFixed(2) + "x";
            if (updateUi && this.ui.slider) this.ui.slider.value = value;

            if (RUBBERBAND_BASE64 === "YOUR_RUBBERBAND_WASM_BASE64_STRING_HERE") {
                if (this.audioEl) this.audioEl.playbackRate = value;
            } else if (this.workletNode) {
                this.workletNode.port.postMessage({ type: 'pitch', value: value });
            }
        }

        connectWebSocket() {
            const wsUrl = `ws://127.0.0.1:${this.apiPort}/ws/plugin/connect/autoplay_tester`;
            this.ws = new WebSocket(wsUrl);

            this.ws.onopen = () => {
                console.log("✅ WS Connected");
                // 연결 성공 시 현재 상태 전송해볼 수 있음
            };

            this.ws.onmessage = (event) => {
                try {
                    const payload = JSON.parse(event.data);
                    if (payload.action === 'set_pitch') {
                        this.setPitch(parseFloat(payload.value), true);
                    }
                } catch (e) { console.error(e); }
            };

            this.ws.onclose = () => {
                setTimeout(() => this.connectWebSocket(), 5000);
            };
        }
    }

    if (document.readyState === 'loading') {
        document.addEventListener('DOMContentLoaded', () => new AudioPitchController());
    } else {
        new AudioPitchController();
    }
})();